import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';

import './Nav.css';

const Nav = () => {

  const [navBar, setNavBar] = useState(false);

  const changeBackground = () => {
    console.log(window.scrollY)
    if(window.scrollY >= 80) {
      setNavBar(true);
    } else {
      setNavBar(false);
    }
  }

  window.addEventListener('scroll', changeBackground);
  return (
    <div>
      <nav className="navbar">
        <div className="navbar-container">
          <ul className="horizontal-list">
            <li className="navLink"><a className="navLink logo" href="https://azure.microsoft.com/en-us"><img className="logo" src="https://upload.wikimedia.org/wikipedia/commons/a/a8/Microsoft_Azure_Logo.svg"></img></a></li>
            <li><Link className="navLink" to="/">Home</Link></li>
            <li><Link className="navLink" to="/explore">Explore</Link></li>
            <li><Link className="navLink" to="/shifting">Shifting</Link></li>
            <li><Link className="navLink" to="/carbon_intensity">Carbon Intensity</Link></li>
            <li><Link className="navLink" to="/documentation">Documentation</Link></li>
          </ul>
        </div>
     	</nav>
      <hr />
    </div>
  );
};

export default Nav;
